import './App.css';
import io from 'socket.io-client';
//import {RegisterApplicantForm} from './components/forms/RegisterApplicantForm'
import {RegisterApplicantForm} from './components/forms/RAF'
import {LoginApplicantForm} from './components/forms/LAF'
import {HomePage} from './components/pages/HomePage'
import {AuthProvider} from './contexts/AC';
import {
    BrowserRouter as Router,
    Switch,
    Route
} from 'react-router-dom';

export const socket = io.connect('http://127.0.0.1:5000/private');

function App() {
  return (
    <Router>
        <AuthProvider>
            <Switch>
                <Route exact path='/' component={HomePage}/>
                <Route path='/register/applicant' component={RegisterApplicantForm}/>
                <Route path='/login/applicant' component={LoginApplicantForm}/>
            </Switch>
        </AuthProvider>
    </Router>
  );
}

export default App;
